import logo from './logo.svg';
import './App.css';



const searchResults = [
  {
  "url": "yandex.ru",
  "title": "cars",
  "text": "i like cars very much",
  "image": "https://avtorinok.ru/photo/pics/aston-martin/v8-vantage/98969.jpg"
  },
  {
  "url": "vk.ru",
  "title": "planes",
  "text": "i like planes not so much",
  "image": "https://i.artfile.ru/5060x2154_1345763_[www.ArtFile.ru].jpg"
  },
  {
  "url": "google.com",
  "title": "trains",
  "text": "i like trains",
  "image": "https://cq.ru/storage/uploads/posts/1680038/1.jpg"
  }
]

function ResultCard({result}) {
    return (
      <li>
        <a href={result.url}>link</a>
        <h1>{result.title}</h1>
        <p>{result.text}</p>
        <img src={result.image}></img>
      </li>
    )
}

function ResultListCard({resultList}) {
    let listElements = resultList.map( result=>
      <ResultCard result={result}/>
    )
    return (
      <ol>{listElements}</ol>
    )
}

function App() {
  return (
    <div className="App">

      <input type="text" id="fname" name="fname"/>
      <button label="search"/>

      <ol>
        <ResultCard result={searchResults[0]}/>
        <ResultCard result={searchResults[1]}/>
        <ResultCard result={searchResults[2]}/>
      </ol>



    </div>
  );
}

export default App;
